Yurtdışından öğrenci kabul kontenjanları dahilinde kayıt yaptıracak öğrencilerden alınacak öğrenim ücretleri;
-önlisans ve lisans programlarında ilgisine göre belirlenen öğrenci katkı payı ve öğrenim ücretinin üç katından az olmamak ve cari maliyetin 5 katını aşmamak üzere,
yükseköğretim kurumları tarafından belirlenir.
